@-moz-document url-prefix("https://www.cs.usfca.edu/~galles/visualization/BPlusTree") {
body {
    width: 800px;
    margin-right: auto;
    margin-left: auto;
    padding: 10px 20px;
    min-height: 1150px;
}

#container{
    min-height: 1150px;
}

#canvas {
    width: 800px;
    filter: greyscale(100%);
}

html {
    background-color: rgb(82, 86, 89);
}

#header, #algoControlSection{
    background-color: white!important;
    color: black!important;
}


#header h1 {
	font-weight: 400!important;
    font-size: 16px!important;
}

#header h1:after {
    margin-left: 20px;
    color: black;
    content: "Załóżmy, że na atrybucie PCT relacji Pracownik zdefiniowano indeks o strukturze B+-drzewa. Przedstaw strukturę indeksu B+-drzewa po wprowadzeniu do relacji Pracownik rekordów o następujących wartościach atrybutu PCT: 5, 7, 11, 12, 2, 1 (w podanej kolejności od lewej do prawej). Uwaga: zakładamy, że rząd wierzchołka wewnętrznego oraz rząd liścia wynoszą pint=pleave=3 Rozwiązanie: Wierzchołki wewnętrzne zawierają od 2 do 3 wskaźników. Liście mają od 1 do 2 wskaźników na dane, bo jeden jest zarezerwowany na wskaźnik do kolejnego liścia. 2. Czy jest możliwe skonstruowanie „mniejszego” B+-drzewa dla podanego zbioru kluczy? Jeżeli nie, to uzasadnij dlaczego. Jeżeli tak, to podaj kolejność wstawiania kluczy i przedstaw wynikowe B+- drzewo. Optymalne drzewo uzyskamy przez wstawianie posortowanych wartości: 1 , 2, 5, 7, 11, 12";
}

#algoControlSection {
    border-bottom: 1px grey solid;
}

input[type="button"]{
    border: none;
    background: transparent;
    font-weight: 600;
    outline: none!important;
}

input[type="text"]{
    border: none;
    border-bottom: 1px solid grey;
    outline: none!important;
}



#footer, #GeneralAnimationControls {
    display: none;
}
}
